"83103":{"id":"83103","name":"Domestic Girlfriend","slug":"domestic-girlfriend","original_title":"ドメスティックな彼女","overview":"Natsuo é um colegial que está enfrentando o esmagador desalento de seu amor não-correspondido por sua professora, Hina. Tentando se animar, ele vai a uma festa de solteiros, onde conhece uma garota chamada Rui. Os dois passam a noite juntos, imaginando que nunca mais se veriam novamente, mas o destino tinha planos para os dois. Sua vida fica ainda mais complicada quando seu pai volta à casa, anunciando que se casou novamente com a mãe de duas garotas que Natsuo conhece: Hina e Rui!","first_air_date":"2019-01-12","episode_run_time":24,"vote_average":8.2,"number_of_seasons":1,"number_of_episodes":12,"created_by":[],"production_companies":["FlyingDog","diomedéa","Bit Promotion","DMM pictures","Kodansha","MBS"],"genres":["Animação","Drama"],"certification":"16","backdrop_path":"https://image.tmdb.org/t/p/original/9uv4pVYNyf7bpm7MIjQOAaBwhbK.jpg","poster_path":"https://image.tmdb.org/t/p/original/AezyTUrSLsOvGcBlX9Qwp756Z1B.jpg","cast":["Maaya Uchida","Yoko Hikasa","Taku Yashiro"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/6ihkJ8YO6PSOUfFfXUlAeQAfJZb.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/6ihkJ8YO6PSOUfFfXUlAeQAfJZb.jpg","air_date":"2019-01-12","episode_count":12,"overview":"N/A","vote_average":6.7,"episodes":{"1":{"name":"Você fará isso comigo aqui?","overview":"A vida de Natsuo dá uma reviravolta quando seu crush e a garota que ele acabou de ficar se tornam suas irmãs de consideração!","air_date":"2019-01-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/inAlnjckkuoUJKNbzWtwLWTLoVi.jpg","vote_average":6.9},"2":{"name":"Por acaso, nós fizemos isso?","overview":"Natsuo tem sentimentos mistos em relação à nova aluna. Hina recebe uma ligação misteriosa que acaba a abalando.","air_date":"2019-01-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/y8fNxE37O2Flo0aGxyk7mQfEWp.jpg","vote_average":6.7},"3":{"name":"Afinal, é verdade?","overview":"Natsuo soube a verdade sobre o relacionamento misterioso de Hina. Depois de uma discussão intensa, Natsuo sai de casa para esfriar a cabeça.","air_date":"2019-01-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/N7r4wOjdpGEsiaESlslL8PNNSN.jpg","vote_average":6.2},"4":{"name":"E você?","overview":"Determinados a fazerem Hina separar de seu namorado, Natsuo e Rui tomam medidas para realizar isso, mas as coisas não saem como planejado.","air_date":"2019-02-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/jA9ah8NqCw2cuxFhS205UYFjCVN.jpg","vote_average":6},"5":{"name":"Tudo bem, se eu me apaixonar por ele?","overview":"Agora que as coisas foram resolvidas, a casa de Natsuo parece mais uma família. Eis que uma aluna mal-falada na escola se aproxima de Rui.","air_date":"2019-02-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/m5A6AEdF8TLwxY6vABguo6nGxK2.jpg","vote_average":6},"6":{"name":"Aqui e agora, tente beijar","overview":"Rui, agora mais acostumada com a escola, resolve dar uma olhada nos clubes para ver em qual gostaria de entrar e pede ajuda pra Natsuo. Eles acabam descobrindo o clube de literatura e Natsuo se envolve em problemas.","air_date":"2019-02-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/mveaXWmWVcHpuSACuD6WSqUZM7I.jpg","vote_average":6.7},"7":{"name":"É isso que significa sair juntos, você sabe?","overview":"Natsuo e Hina saem sozinhos e vão até o mar. Lá eles acabam conversando um pouco sobre os últimos acontecimentos.","air_date":"2019-02-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/vqqMs0jUgJuv1qQPzxDCeRWTmhR.jpg","vote_average":7.3},"8":{"name":"Então eu não preciso ser um adulto","overview":"Natsuo conhece um novo aluno de sua escola, Alex. Ele fica interessado em Rui e Natsuo acaba sendo direto demais ao dizer isso. Como parte do pedido de desculpas, eles se beijam, mas acabam sendo flagrados...","air_date":"2019-03-02","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/oxFXroipY6CgqmkRI1eGycAvfNW.jpg","vote_average":7},"9":{"name":"Não diga isso, por favor?","overview":"Hina, mesmo depois de confessar seus sentimentos ao Natsuo, resolve morar sozinha e isso afeta intensamente tanto seu amado quanto sua irmã mais nova, Rui.","air_date":"2019-03-09","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/dCYobrWZokcYM3AHEfWqhzJVS42.jpg","vote_average":7},"10":{"name":"Mentiras...","overview":"Depois do festival cultural, os alunos do clube de literatura estão conversando enquanto vão para sua sala de atividades. Natsuo insiste num assunto que a Ashihara discorda e acaba sendo empurrado e cai da escada, trincando o osso da perna. Agora Natsuo não pode sair de casa a hora que quiser...","air_date":"2019-03-16","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/iUW68Pf4Gb9gl7quxrp02NBULab.jpg","vote_average":7},"11":{"name":"Você tem certeza?","overview":"Depois de ser flagrado, Natsuo acaba contando toda a verdade pra Rui. Apesar de estar de coração partido, ela toma uma decisão.","air_date":"2019-03-23","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tj3im7UtSQBvrLSAIOWt9eSonbg.jpg","vote_average":7},"12":{"name":"Sinto muito, eu te amo.","overview":"O diretor da escola descobriu o relacionamento de Hina e Natsuo. Ela parece disposta a fazer o que for para proteger seu amado.","air_date":"2019-03-30","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/1e9D6uXN0vX7Z9nbOTlnfnRqMzf.jpg","vote_average":6.5}}}}},
