"205366":{"id":"205366","name":"Como Raeliana Foi Parar na Mansão do Duque","slug":"como-raeliana-foi-parar-na-mansao-do-duque","original_title":"彼女が公爵邸に行った理由","overview":"Quando Rinko sofre um acidente e acorda em outro mundo, ela percebe exatamente onde está: no corpo de Raeliana McMillan, personagem de um romance vitoriano que ela leu. Mas, apesar de viver com todos os confortos e regalias que alguém poderia querer, ela sabe o que o futuro lhe reserva: morrer nas mãos de seu noivo para instigar a trama principal da história. Determinada a mudar seu destino, ela se aproxima do duque Noah Wynknight, herdeiro do trono, e lhe propõe um acordo: fingir ser sua noiva por seis meses para escapar de seu destino cruel.","first_air_date":"2023-04-10","episode_run_time":23,"vote_average":7.3,"number_of_seasons":1,"number_of_episodes":12,"created_by":["밀차"],"production_companies":["Typhoon Graphics","Frontier Works","Crunchyroll","Happinet Phantom Studios","AT-X","Bandai Namco Music Live","armabianca","KADOKAWA","D&C WEBTOON Biz"],"genres":["Animação","Comédia","Mistério","Sci-Fi & Fantasy"],"certification":"14","backdrop_path":"https://image.tmdb.org/t/p/original/hWk3qCboi8nJE9X34WCXDxb2b8R.jpg","poster_path":"https://image.tmdb.org/t/p/original/tj1CA3jzpIrd8NG7mDObRcLKQJ5.jpg","cast":["宮本侑芽","Yuichiro Umehara","Shuichiro Umeda","土岐隼一","Akira Ishida"],"trailer":"RyjDMvQhhdg","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/3RMijmls73QQ5vq9YvtdnABYrMM.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/3RMijmls73QQ5vq9YvtdnABYrMM.jpg","air_date":"2023-04-10","episode_count":12,"overview":"N/A","vote_average":6.3,"episodes":{"1":{"name":"Por que Raeliana Fez Um Acordo","overview":"Rinko Hanasaki tirou um ano para de dedicar aos estudos para os vestibulares, mas não passou em nenhum. No instante em que ela recebe a mensagem de aprovação em 2ª chamada, ela morre e renasce como Raeliana, a personagem de um livro que morre nos primeiros capítulos.","air_date":"2023-04-10","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/i1EVBKnF0QcpwsO5GMOvA9lm1yA.jpg","vote_average":7},"2":{"name":"Por que Raeliana Firmou Um Contrato","overview":"Na manhã seguinte à festa, Raeliana acorda de ressaca e com uma visita em sua casa: o duque. Eles então começam as negociações para que ela possa romper o noivado com o Lorde Brooks e, para isso, usará todo o conhecimento que tem do mundo do livro.","air_date":"2023-04-17","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/aEZQHQNzx7vzvmX6J0JERrOAR7m.jpg","vote_average":7},"3":{"name":"Por que Raeliana Aprendeu a Cuidar da Casa","overview":"Raeliana se muda para a mansão do duque e começa a ter aulas para ser uma boa noiva e esposa. Além disso, ela conversa com seu noivo para estabelecerem regras menores que não estão no contrato, fazendo o relacionamento dos dois parecer real a todos.","air_date":"2023-04-24","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/hkVp06rIN2JPW1EIwkFqeFyRNGk.jpg","vote_average":6.3},"4":{"name":"Por que Raeliana Comprou Uma Briga","overview":"É o dia do baile e Noah aumentou a escolta de Raeliana para 4 guardas, além de Taylor. Como esperado, todos parecem estar falando do noivado dos dois, mas isso não impede Noah de dar uma missão à jovem: ser convidada para um encontro das esposas dos nobres.","air_date":"2023-05-01","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/12Mb1UGTKSndefPDdGRniUAatWU.jpg","vote_average":6},"5":{"name":"Por que Raeliana Foi Raptada","overview":"Raeliana acorda numa carroça e se vê diante de Jake Langston. Para sair dessa situação, ela começa a conversar com seu raptor e descobre que ele perdeu a irmã por causa de Francis Brooks. Desde então, Jake vem se vingando do nobre.","air_date":"2023-05-08","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/zXDyVAKysz3oyTtKemBtlLsKXqF.jpg","vote_average":5.7},"6":{"name":"Por que Raeliana Se Fantasiou","overview":"Raeliana acorda na cama com Noah, ele sem camisa e ela com certas dores. A jovem decide pedir ajuda do mestre Taylor para fugir da situação e ficar um tempo sozinha, mas Noah coloca todos os cavaleiros atrás dela.","air_date":"2023-05-15","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/xsD6Nz3Y2lJPFqdihGNT4KcylHl.jpg","vote_average":6.3},"7":{"name":"Por que Raeliana Deu Um Lenço","overview":"Em preparação para o inverno, os nobres guerreiros do reino vão caçar monstros nas montanhas para evitar que cidadãos comuns sejam atacados. Esse evento conta com diversas tradições, como, por exemplo, que donzelas entreguem lenços a seus amados antes de partirem e que, na volta, os caçadores ofereçam, às donzelas, os melhores monstros.","air_date":"2023-05-22","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/4d0M62aw1eba0gbjZ2n5Qu1kmVZ.jpg","vote_average":6.7},"8":{"name":"Por que Raeliana Vai Ao Templo","overview":"A equipe de caça de Noah retorna e traz à Raeliana, um grande monstro como presente. Por conta disso, ela é a escolhida para acender a chama cerimonial no templo e se prepara para partir.","air_date":"2023-05-29","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/tfZJdTCuJatn9SZF8G0LWVt8pVN.jpg","vote_average":6.3},"9":{"name":"Por que Chamaram Raeliana de Selvagem","overview":"Raeliana foi designada para acender a chama sagrada, mas, para isso, terá que passar por um processo de purificação não muito agradável. Enquanto espera no jardim do templo, ela se depara com uma criança diferente.","air_date":"2023-06-05","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/2B8b3NdNhYajWapOMPLhAXcVtjS.jpg","vote_average":6},"10":{"name":"Por que Raeliana o Chamou de Vovô","overview":"Chega o dia da cerimônia de acender a chama sagrada e os portões para a Terra Santa se abrem para a ocasião. No entanto, um acontecimento inesperado coloca a vida de Raeliana em risco, o que parece abalar Noah profundamente.","air_date":"2023-06-12","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/nNP9S1wiHAAKkrbeBdLDD0wpSua.jpg","vote_average":6},"11":{"name":"Por que Raeliana se Fez de Desentendida","overview":"Depois de sua estadia no templo, Raeliana retorna à vida pacata da mansão. Contudo, ela continua incomodada por saber que mudou a história e tenta meios pouco ortodoxos para descobrir o paradeiro de Beatrice.","air_date":"2023-06-19","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/mZMYj97ezJQ8RRGLOm42VzQRLEY.jpg","vote_average":6},"12":{"name":"Por que Raeliana Acabou na Mansão do Duque","overview":"A sessão do parlamento acaba, e Raeliana volta de sua ida ao cemitério na tentativa de encontrar Beatrice. Porém, como ela saiu às pressas, não se agasalhou direito e acabou se resfriando. Sua condição preocupa todos da mansão, inclusive Noah.","air_date":"2023-06-26","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/u9sw1jmXlDjFp0iLvF5gelmZpYX.jpg","vote_average":6.7}}}}},
